import React from "react";
import "../styles/ExploreResources.css";

function ExploreResources() {
    return (
        <div className="explore-resources">
            <h1>Explore Resources</h1>
            <p>Discover useful resources to help you live a more sustainable life and contribute to environmental protection.</p>
            <ul>
                <li>Eco-friendly product guides</li>
                <li>Local environmental initiatives</li>
                <li>Research articles on climate change</li>
                <li>Educational videos and documentaries</li>
            </ul>
        </div>
    );
}

export default ExploreResources;
